sect1.para:
Usually, you first create an instance: QCPCurve*newCurve=newQCPCurve(customPlot->xAxis,customPlot->yAxis);
 add it to the customPlot with QCustomPlot::addPlottable: customPlot->addPlottable(newCurve);
 and then modify the properties of the newly created plottable, e.g.: newCurve->setName("Fermat'sSpiral");
newCurve->setData(tData,xData,yData);
